import React from 'react';
import styled from "styled-components";
import {Container, Title} from "../../styles/common";

const StyledSubscribe = styled(Container)`
  background-image: url("../../img/subscribe/background.jpg");
  background-repeat: no-repeat;
  background-size: cover;
  display: flex;
  align-items: center;
  justify-content: space-between;
  gap: 2rem;
`

const SubscribeTitle = styled(Title)`
`

function Subscribe() {
  return (
    <StyledSubscribe>
      <Title $color="#FFFFFF">Subscribe to our Newsletter</Title>
    </StyledSubscribe>
  );
}

export default Subscribe;
